import './components.css'

function Themes(){
    return(
        <div class='themes-section'>
            <div class='themes-sense-of-direction'>
                <h1 class='themes-header'> SENSE OF DIRECTION </h1>
                <input type="Checkbox" name="blue" value="yes" />
                <input type="Checkbox" name="red" value="yes" />
                <input type="Checkbox" name="green" value="yes" />
                
            </div>
            <h1> SENSE OF URGENCY </h1>
        </div>
    )   
}


export default Themes;
